script: |
  super -f text -I q8905.spq | sort > q8905.out

inputs:
  - name: q8905.spq
    data: |
      SELECT + - col2 AS col1 FROM tab1 (FORMAT parquet) WHERE NOT + col1 * + + 14 IN ( + col2, + col0 * col1, ( - col1 ) );
  - name: tab1

outputs:
  - name: q8905.out
    data: |
      -59
      -68
      -96
